sources.../scss/sosgames.scss:
@import "nullstyle";
@import url('https://fonts.googleapis.com/css2?family=Open+Sans:wght@400;700&display=swap');

@font-face {
  font-family: 'BebasNeue';
  src: url('../fonts/bebasneue/BebasNeue Regular.ttf') format('truetype');
  font-style: normal;
  font-weight: normal;
}

body {
  background-color: #000000;
}

.container {
  width: 100%;
  padding-right: 15px;
  padding-left: 15px;
  margin-right: auto;
  margin-left: auto;

  @media screen and (min-width: 320px) {
    width: 320px;
    margin: 0 auto;
  }

  @media screen and (min-width: 594px) {
    width: 594px;
    margin: 0 auto;
  }

  @media screen and (min-width: 768px) {
    width: 768px;
    margin: 0 auto;
  }

  @media screen and (min-width: 992px) {
    width: 992px;
    margin: 0 auto;
  }

  @media screen and (min-width: 1200px) {
    width: 1200px;
    margin: 0 auto;
  }

  @media screen and (min-width: 1400px) {
    width: 1400px;
    margin: 0 auto;
  }
}

.section {
  background-image: url("../img/pictures/bg-section-header.png");
  background-position: top center;
  background-size: cover;
  background-repeat: no-repeat;
  height: 100vh;

  @media screen and (min-width: 992px) {
    width: 100%;
    height: 100%;
  }
}

.title-block {
  font-family: BebasNeue, serif;
  display: flex;
  justify-content: center;
  color: white;
  font-weight: 700;

  &_bg {
    display: flex;
    justify-content: center;
    letter-spacing: 3px;

    @media screen and (min-width: 320px) {
      font-size: 33px;
      line-height: 33px;
      margin-bottom: 8px;
    }

    @media screen and (min-width: 594px) {
      font-size: 62px;
      line-height: 57px;
    }

    @media screen and (min-width: 992px) {
      font-size: 80px;
      line-height: 80px;
    }
  }

  &_sm {
    display: flex;
    justify-content: center;
    letter-spacing: 2px;

    @media screen and (min-width: 320px) {
      font-size: 15px;
      line-height: 18px;
    }

    @media screen and (min-width: 594px) {
      font-size: 22px;
      line-height: 20px;
    }

    @media screen and (min-width: 992px) {
      font-size: 24px;
      line-height: 24px;
    }
  }
}

.nav {
  font-family: Open Sans, serif;
  display: flex;
  line-height: 16px;
  font-size: 11px;
  font-weight: 700;

  &__item {
    margin: 0 19px;

    &:hover {
      text-decoration: underline;
    }

    @media screen and (min-width: 320px) {
      padding-top: 21px;
    }

    @media screen and (min-width: 594px) {
      padding-top: 0;
    }

    @media screen and (min-width: 1400px) {
      padding-right: 40px;
    }
  }

  &__link {
    color: white;
  }
}

.header-nav {
  @media screen and (min-width: 320px) {
    display: none;
  }

  @media screen and (min-width: 594px) {
    display: flex;
    align-items: center;
    font-size: 8px;
    margin: 0px -10px;
  }

  @media screen and (min-width: 768px) {
    font-size: 12px;
    margin: 0;
  }
}

.header  {
  align-items: center;
  padding-top: 22px;
  margin-bottom: 214px;

  @media screen and (min-width: 320px) {
    display: flex;
    justify-content: space-between;
    margin-bottom: 187px;
  }

  @media screen and (min-width: 594px) {
    display: flex;
    justify-content: space-around;
  }

  &__logo{

    img {
      @media screen and (min-width: 320px) {
        width: 32px;
        height: 32px;
      }

      @media screen and (min-width: 594px) {
        width: 43px;
        height: 43px;
      }

      @media screen and (min-width: 768px) {
        width: 55px;
        height: 55px;
      }
    }
  }

  &__icons {
    display: flex;
    align-items: center;
  }

  &__lang {
    font-family: Open Sans, serif;
    line-height: 16px;
    font-size: 12px;
    font-weight: 700;
    color: white;

    &:hover {
      cursor: pointer;
    }

    &:after {
      content: url("../img/icons/Vector 2.svg");
      width: 7.3px;
      height: 3.2px;
      margin: 10px;
    }

    border-right: 0.873968px solid rgba(255, 255, 255,.5);
  }

  &__xbox {

    &:hover {
      opacity: 0.7;
      cursor: pointer;
    }

    @media screen and (min-width: 320px) {
      display: none;
    }

    @media screen and (min-width: 594px) {
      display: flex;
      width: 30px;
      padding: 0 6px;
      margin: 0 -10px 0 5px;
    }
  }

  &__steam {

    &:hover {
      opacity: 0.7;
      cursor: pointer;
    }

    @media screen and (min-width: 320px) {
      display: none;
    }

    @media screen and (min-width: 594px) {
      display: flex;
      width: 30px;
      padding: 0 6px;
      margin: 0 -10px 0 5px;
    }
  }

  &__story-scroll {
    font-family: Open Sans, serif;
    font-size: 12px;
    font-weight: 700;
    line-height: 22px;
    text-align: center;
    color: white;
    bottom: 30px;
    position: absolute;
    left: 45px;
    transform: translateX(-50%);

    &:after {
      content: url("../img/icons/scroll down.svg");
      margin-left: -43px;
      margin-top: 23px;
      position: absolute;
    }

    @media screen and (min-width: 594px) {
      bottom: 29px;
      left: 50%;
    }

    @media screen and (min-width: 768px) {
      bottom: 20px;
    }

    @media screen and (min-width: 1400px) {
      bottom: 61px;
    }
  }
}

.brgr-menu {
  background-color: transparent;

  &__icon {

    @media screen and (min-width: 320px) {
      display: flex;
      width: 30px;
      padding: 0 6px;
      margin: 0 -10px 0 5px;
    }

    @media screen and (min-width: 594px) {
      display: none;
    }
  }
}

.section {

  &__title {
    font-family: BebasNeue, serif;
    display: flex;
    justify-content: center;
    font-weight: 700;
    font-size: 80px;
    line-height: 80px;
  }
}

.button {
  background-color: rgba(255, 181, 72, 1);
  display: flex;
  justify-content: center;
  font-family: Open Sans, serif;
  font-weight: 700;
  padding: 17px 17px 20px 17px;
  border-radius: 4px;

  &:hover {
    background-color: orange;
  }

  @media screen and (min-width: 320px) {
    font-size: 14px;
    line-height: 19px;
    margin: 12px auto;
  }

  @media screen and (min-width: 594px) {
    font-size: 16px;
    margin: 28.5px auto;
  }

  &__border {
    opacity: 50%;
    color: #000;
    margin: 0 8px;
  }
}

.header__slider {
  position: absolute;
  bottom: 40px;
  right: 158px;

  @media screen and (min-width: 594px) {
    display: none;
  }
}

.header__item {

  &:before {
    content: "";
    position: absolute;
    width: 16px;
    height: 16px;
    border-radius: 50%;
    border: 1px solid #ffffff;
  }

  &_active:before {
    background-color: #fff;
  }

  &:nth-child(2) {
    &:before {
      left: 26px;
    }
  }

  &:nth-child(3) {
    &:before {
      left: 52px;
    }
  }

  &:nth-child(4) {
    &:before {
      left: 78px;
    }
  }
}

.header__arrow {
  position: absolute;
  left: 104px;
  top: 3px;
}

.section-battle {
  background-image: url("../img/pictures/bg-section-battle.png");
  background-position: top center;
  background-size: cover;
  background-repeat: no-repeat;
  width: 100%;

  @media screen and (min-width: 320px) {
    padding: 50px 0;
  }

  @media screen and (min-width: 992px) {
    padding: 90px 0;
  }

  @media screen and (min-width: 1400px) {
    padding: 174px 0;
  }

  &__info {
    color: white;
    font-weight: 700;
    font-family: BebasNeue, serif;

    @media screen and (min-width: 320px) {
      padding-top: 0;
    }

    @media screen and (min-width: 768px) {
      width: 44%;
    }

    @media screen and (min-width: 992px) {
      padding-top: 60px;
      z-index: 3;
      position: relative;
      width: 100%;
    }

    @media screen and (min-width: 1400px) {
      padding-left: 120px;
    }
  }

  &__slider {
    position: relative;

    @media screen and (min-width: 320px) {
      margin: 27px 0 auto 16px;;
      width: 100%;
      padding-bottom: 235px;
    }

    @media screen and (min-width: 594px) {
      padding-left: 167px;
      margin: 27px auto;
      padding-bottom: 277px;
    }

    @media screen and (min-width: 768px) {
      padding-bottom: 388px;
      padding-left: 144px;
    }

    @media screen and (min-width: 992px) {
      width: 78%;
      display: inline-flex;
      justify-content: flex-end;
      padding-left: 0;
      margin-right: 82px;
      padding-bottom: 0;
    }
  }

  &__pic-bg {
    position: absolute;
    z-index: 2;

    @media screen and (min-width: 320px) {
      width: 75%;
    }

    @media screen and (min-width: 594px) {
      width: 41%;
      margin-left: -44px;
    }

    @media screen and (min-width: 768px) {
      width: 65%;
      margin-top: 11px;
      margin-left: -77px;
    }

    @media screen and (min-width: 992px) {
      width: 100%;
      margin-left: 55px;
      margin-top: 23px;
    }

    @media screen and (min-width: 1400px) {
      width: 83%;
      bottom: -88px;
      left: -158px;
    }
  }

  &__pic-md {
    position: absolute;
    z-index: 1;
    border-radius: 5px;

    @media screen and (min-width: 320px) {
      width: 66%;
      margin-left: 44px;
      margin-top: 10px;
    }

    @media screen and (min-width: 594px) {
      width: 35%;
      margin-left: 5px;
      margin-top: 12px;
    }

    @media screen and (min-width: 768px) {
      width: 56%;
      margin-left: -24px;
      margin-top: 25px;
    }

    @media screen and (min-width: 992px) {
      width: 90%;
      left: 79px;
      margin-top: 34px;
    }

    @media screen and (min-width: 1400px) {
      width: 74%;
      bottom: -72px;
      left: -10px;
    }
  }

  &__pic-sm {
    position: absolute;
    z-index: 0;
    border-radius: 5px;

    @media screen and (min-width: 320px) {
      width: 65%;
      margin-left: 60px;
      margin-top: 24px;
    }

    @media screen and (min-width: 594px) {
      width: 36%;
      margin-left: 14px;
      margin-top: 22px;
    }

    @media screen and (min-width: 768px) {
      width: 55%;
      margin-left: -3px;
      margin-top: 42px;
    }

    @media screen and (min-width: 992px) {
      width: 93%;
      left: 63px;
      margin-top: 47px;
    }

    @media screen and (min-width: 1400px) {
      width: 77%;
      bottom: -57px;
      left: -23px;
    }
  }
}

.dotes-switch {
  position: absolute;
  z-index: 3;

  @media screen and (min-width: 320px) {
    left: 37px;
    top: 227px;
  }

  @media screen and (min-width: 594px) {
    left: 169px;
    top: 243px;
  }

  @media screen and (min-width: 768px) {
    top: 291px;
    left: 122px;
  }

  @media screen and (min-width: 992px) {
    top: 439px;
    left: 115px;
  }

  @media screen and (min-width: 1400px) {
    top: 483px;
    left: 3px;
  }
}

.dotes {
  display: flex;

  &_full {
    height: 10px;

    @media screen and (min-width: 768px) {
      height: 14px;
    }
  }

  &_bar {
    margin-left: -2px;
  }

  &_emp {
    padding-left: 14px;
    height: 10px;

    @media screen and (min-width: 768px) {
      height: 14px;
    }

    @media screen and (min-width: 1400px) {
      padding-left: 30px;
    }
  }
}

.switch {
  position: absolute;

  @media screen and (min-width: 320px) {
    bottom: 100px;
    left: 225px;
  }

  @media screen and (min-width: 768px) {
    left: 260px;
    bottom: 117px;
  }

  @media screen and (min-width: 992px) {
    left: 317px;
    bottom: 173px;
  }

  @media screen and (min-width: 1400px) {
    left: 406px;
    bottom: 234px;
  }
}

.battle-sector {
  display: flex;

  @media screen and (min-width: 320px) {
    flex-direction: column;
  }

  @media screen and (min-width: 594px) {
    flex-direction: column;
  }

  @media screen and (min-width: 768px) {
    justify-content: space-around;
    flex-direction: row;
  }
}

.title-battle {

  &_sm {
    letter-spacing: 2px;

    @media screen and (min-width: 320px) {
      font-size: 18px;
      line-height: 18px;
      margin-bottom: 6px;
    }

    @media screen and (min-width: 594px) {
      font-size: 22px;
      line-height: 20px;
    }

    @media screen and (min-width: 992px) {
      font-size: 24px;
      line-height: 24px;
    }
  }

  &_bg {
    letter-spacing: 3px;

    @media screen and (min-width: 320px) {
      font-size: 33px;
      line-height: 33px;
      min-width: max-content;
    }

    @media screen and (min-width: 594px) {
      font-size: 62px;
      line-height: 57px;
    }

    @media screen and (min-width: 992px) {
      font-size: 80px;
      line-height: 80px;
    }
  }
}

.border {
  background-color: #fff;
  border-radius: 4px;
  z-index: 3;

  @media screen and (min-width: 320px) {
    margin-top: 30px;
    width: 290px;
    height: 2px;
  }

  @media screen and (min-width: 594px) {
    width: 477px;
  }

  @media screen and (min-width: 992px) {
    height: 4px;
    width: 100%;
  }
}

.text-block {
  font-family: Open Sans, serif;
  color: white;
  font-weight: 400;
  text-align: justify;

  @media screen and (min-width: 320px) {
    padding-left: 18px;
    margin-right: 0;
    min-width: 292px;
    margin-top: 27px;
    font-size: 14px;
    line-height: 16px;
