.button-sub {
  background-color: rgba(255, 181, 72, 1);
  display: flex;
  justify-content: center;
  font-family: Open Sans, serif;
  line-height: 22px;
  font-size: 16px;
  font-weight: 700;
  padding: 16px 38px 16px 31px;
  border-radius: 4px;
  width: 41.5%;
  margin-left: 17px;

  &:hover {
    background-color: orange;
  }

  @media screen and (min-width: 320px) {
    width: 100%;
    margin-top: 20px;
    margin-left: 0;
  }

  @media screen and (min-width: 992px) {
    margin-top: 0;
  }
}

.section-footer {

  @media screen and (min-width: 320px) {
    margin-top: 91px;
  }

  @media screen and (min-width: 992px) {
    margin-top: 35px;
  }
}

.footer {

  &__top {
    display: flex;
    justify-content: space-between;
    align-items: center;

    @media screen and (min-width: 320px) {
      flex-direction: column;
    }

    @media screen and (min-width: 768px) {
      flex-direction: row;
    }
  }

  &__logo {

    @media screen and (min-width: 320px) {
      width: 50px;
      height: 50px;
      margin-bottom: 21px;
    }

    @media screen and (min-width: 768px) {
      width: 90px;
      height: 90px;
    }
  }

  &__pic {
    width: 100%;
  }

  &__icons {
    display: flex;
    align-items: center;

    @media screen and (min-width: 320px) {
      margin-bottom: 21px;
      padding-top: 21px;
    }
  }

  &__facebook {
    fill: white;

    @media screen and (min-width: 320px) {
      margin-right: 55px;
    }

    @media screen and (min-width: 768px) {
      margin-right: 25px;
    }

    @media screen and (min-width: 992px) {
      margin-right: 55px;
    }

    &:hover {
      fill: midnightblue;
      cursor: pointer;
    }
  }

  &__twitter {
    fill: white;

    @media screen and (min-width: 320px) {
      margin-right: 55px;
    }

    @media screen and (min-width: 768px) {
      margin-right: 25px;
    }

    @media screen and (min-width: 992px) {
      margin-right: 55px;
    }

    &:hover {
      fill: dodgerblue;
      cursor: pointer;
    }
  }

  &__youtube {
    fill: white;

    @media screen and (min-width: 320px) {
      margin-right: 55px;
    }

    @media screen and (min-width: 768px) {
      margin-right: 25px;
    }

    @media screen and (min-width: 992px) {
      margin-right: 55px;
    }

    &:hover {
      fill: firebrick;
      cursor: pointer;
    }
  }

  &__twitch {
    fill: white;

    &:hover {
      fill: forestgreen;
      cursor: pointer;
    }
  }

  &__bottom {
    display: flex;
    justify-content: space-between;
    color: white;
    margin: 12px 0 50px 0;

    @media screen and (min-width: 320px) {
      flex-direction: column;
    }

    @media screen and (min-width: 594px) {
      justify-content: space-between;
      flex-direction: row;
    }

    &_left {
      font-family: Open Sans, serif;
      font-weight: 400;
      opacity: 50%;

      @media screen and (min-width: 320px) {
        font-size: 12px;
        line-height: 16px;
        text-align: center;
      }

      @media screen and (min-width: 594px) {
        text-align: left;
        font-size: 10px;
        line-height: 0;
        margin-top: 6px;
      }

      @media screen and (min-width: 992px) {
        font-size: 14px;
        line-height: 19px;
      }
    }

    &_right {
      font-family: Open Sans, serif;
      font-weight: bold;
      letter-spacing: 0.1em;
      text-transform: uppercase;

      @media screen and (min-width: 320px) {
        font-size: 12px;
        line-height: 34px;
        text-align: center;
        margin: 0 auto 55px auto;
        width: 52%;
      }

      @media screen and (min-width: 594px) {
        line-height: 21px;
        font-size: 8px;
        justify-content: flex-end;
        margin: 0;
      }

      @media screen and (min-width: 992px) {
        font-size: 12px;
        line-height: 34px;
        margin-top: 9px;
      }
    }
  }
}

.link {
  color: white;

  @media screen and (min-width: 320px) {
    margin-bottom: 12px;

    &:nth-child(2) {
      border-left: 1px solid #fff;
      border-right: 1px solid #fff;
      height: 12px;
      line-height: 13px;
    }
  }

  @media screen and (min-width: 594px) {
    border-right: 1px solid #fff;
    height: 12px;
    padding-right: 6px;
    margin-left: 6px;
    line-height: 13px;
    margin-bottom: 0;

    &:last-of-type {
      border-right: none;
      padding-right: 0;
    }

    &:first-of-type {
      margin-left: 0;
    }

    &:nth-child(2) {
      border-left: none;
    }
  }

  &:hover {
    text-decoration: underline;
  }
}

.footer-hr {
  height: 0.873968px;
  background-color: rgba(255, 255, 255,.5);
  width: 100%;
}

.footer-nav {

  @media screen and (min-width: 320px) {
    flex-wrap: wrap;
    padding-top: 21px;
    justify-content: center;

    &:first-child:active::after {
      content: url("../img/icons/red dot.svg");
    }
  }

  @media screen and (min-width: 768px) {
    display: flex;
    flex-wrap: nowrap;
    align-items: center;
    padding-top: 8px;
  }
}

